function _title()
{
  const title = document.createElement("h1");
  title.innerText = "Bootloader - Notebook 1.0 stdlib";
  return title;
}


async function _conf(){return(
(await import("file://bootconf.json")).default
)}

function _library(highlight,marked,stdlib)
{
  highlight;
  marked;
  return new stdlib.Library();
}


function _define_builtins(library,__ojs_runtime,stdlib)
{
  Object.keys(library).forEach((name) => {
    __ojs_runtime._builtin.define(name, [], library[name]);
  });
  __ojs_runtime.fileAttachments = stdlib.FileAttachments;
}


function _boot(define_builtins,conf,location,__ojs_observer,__ojs_runtime,importShim)
{
  define_builtins;
  if (conf.hash && !location.hash) {
    location.hash = conf.hash;
  }
  const observer = conf.headless ? () => ({}) : __ojs_observer;
  __ojs_runtime.mains = new Map();
  window.__ojs_runtime = __ojs_runtime;
  conf.mains.map(async (name) => {
    const module = await importShim(name);
    const ojs_module = __ojs_runtime.module(module.default, observer);
    __ojs_runtime.mains.set(name, ojs_module);
  });
}


